import React from 'react'
import './Banner.css'

function Banner() {
  return (
    <div className="Banner">
        <div className="BannerImage">
           
                <img className='BannerImage' src="https://cdn.s3waas.gov.in/s3bd4c9ab730f5513206b999ec0d90d1fb/uploads/2018/05/2018050344.jpg" alt="" />
          
        </div>
    </div>
  )
}

export default Banner
